.Home_container__d256j { min-height: 100vh; padding: 0px 0.5rem; display: flex; flex-direction: column; justify-content: center; align-items: center; height: 100vh; }.Home_main__VkIEL { padding: 5rem 0px; flex: 1 1 0%; display: flex; flex-direction: column; justify-content: center; align-items: center; }.Home_footer__yFiaX { width: 100%; height: 100px; border-top: 1px solid rgb(234, 234, 234); display: flex; justify-content: center; align-items: center; }.Home_footer__yFiaX a { display: flex; justify-content: center; align-items: center; flex-grow: 1; }.Home_title__hYX6j a { color: rgb(0, 112, 243); text-decoration: none; }.Home_title__hYX6j a:hover, .Home_title__hYX6j a:focus, .Home_title__hYX6j a:active { text-decoration: underline; }.Home_title__hYX6j { margin: 0px; line-height: 1.15; font-size: 4rem; }.Home_title__hYX6j, .Home_description__uXNdx { text-align: center; }.Home_description__uXNdx { line-height: 1.5; font-size: 1.5rem; }.Home_code__VVrIr { background: rgb(250, 250, 250); border-radius: 5px; padding: 0.75rem; font-size: 1.1rem; font-family: Menlo, Monaco, "Lucida Console", "Liberation Mono", "DejaVu Sans Mono", "Bitstream Vera Sans Mono", "Courier New", monospace; }.Home_grid__AVljO { display: flex; align-items: center; justify-content: center; flex-wrap: wrap; max-width: 800px; margin-top: 3rem; }.Home_card__E5spL { margin: 1rem; padding: 1.5rem; text-align: left; color: inherit; text-decoration: none; border: 1px solid rgb(234, 234, 234); border-radius: 10px; transition: color 0.15s ease 0s, border-color 0.15s ease 0s; width: 45%; }.Home_card__E5spL:hover, .Home_card__E5spL:focus, .Home_card__E5spL:active { color: rgb(0, 112, 243); border-color: rgb(0, 112, 243); }.Home_card__E5spL h2 { margin: 0px 0px 1rem; font-size: 1.5rem; }.Home_card__E5spL p { margin: 0px; font-size: 1.25rem; line-height: 1.5; }.Home_logo__IOQAX { height: 1em; margin-left: 0.5rem; }@media (max-width: 600px) {
  .Home_grid__AVljO { width: 100%; flex-direction: column; }
}

